import React, {Component} from 'react';

class ToDo  extends Component {
    constructor(props){
        super(props)
        this.anarana = this.props.nom
        this.task = this.props.task
    }



    render(){   
        return (
            <li className="list-group-item d-flex align-tiems-center">
                {this.anarana}
                <button className="btn ml-auto btn-outline-success" onClick={()=>this.toglleCompleted()}>&#x2713;</button>
            </li>
        )//end return in render()
    }//end render()

}//end ToDoClass

export default ToDo;
